import React from "react";

export default function ManagerLeaveRequests({ requests = [], onAction }) {
  return (
    <div>
      <h2>Leave Requests</h2>
      {requests.length === 0 ? (
        <p>No leave requests</p>
      ) : (
        <ul>
          {requests.map((req, index) => (
            <li key={index}>
              {req.employeeName} - {req.days} days 
              <button onClick={() => onAction(req.id, "approve")}>Approve</button>
              <button onClick={() => onAction(req.id, "reject")}>Reject</button>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}
